<!DOCTYPE html><html lang="en"><head><meta charset="UTF-8"/><meta http-equiv="X-UA-Compatible" content="IE=edge"/><meta name="viewport" content="width=device-width,initial-scale=1"/><style>:root{--background:#90aeac}body,html{margin:0}body{background-color:#f0f8ff;height:100%}.container{display:flex;flex-wrap:wrap;width:100vw}.sectioncontainer{margin-left:.5%;margin-top:10px}.background{background-color:var(--background)}.modal{position:absolute;width:800px;height:800px;top:0;bottom:0;left:0;right:0;margin:auto}.overlay{background-color:rgba(0,0,0,.3);position:absolute;width:100%;height:100%;inset:0;display:none}#leftcontainer{width:650px}#middlecontainer{width:550px}#rightcontainer{width:650px}#devicelabel{display:none}@media only screen and (min-width:800px){#leftcontainer{width:270px}#middlecontainer{width:220px}#rightcontainer{width:270px}.modal{width:700px;height:350px}}@media only screen and (min-width:1400px){#leftcontainer{width:485px}#middlecontainer{width:395px}#rightcontainer{width:485px}.modal{width:800px;height:800px}}@media only screen and (min-width:1800px){#leftcontainer{width:600px}#middlecontainer{width:500px}#rightcontainer{width:600px}.modal{width:800px;height:800px}}</style><title>PERISCOPE | Healthplus.ai</title></head><body><div class="container"><div class="overlay" id="overlay"></div><div class="sectioncontainer background" id="leftcontainer"><img src="data:image/jpeg;base64, " width="100%" height="100%"/></div><div class="sectioncontainer" id="middlecontainer"><img src="data:image/jpeg;base64, " width="100%" height="100%"/></div><div class="sectioncontainer" id="rightcontainer"><img src="data:image/jpeg;base64, " width="100%" height="100%"/><div></div></div><div class="modal" id="devicelabel"><div><div><img src="data:image/jpeg;base64, " width="100%" height="100%"/></div></div></div></div><script type="text/javascript">document.querySelector(".container").addEventListener('click', (e) => {
            let element = document.getElementById("devicelabel");
            let overlay = document.getElementById("overlay");
            if (element.style.display != 'block') {
                element.style.display = 'block';
                overlay.style.display = 'block';
            } else {
                element.style.display = 'none';
                overlay.style.display = 'none';
            }
        });</script></body></html>